


"""
To overcome memory exceed limit error, we need to reduce space from 2d to 1d

instead consider canjump from i to j, only consider 0 to i(or i to len(nums)-1)

back-tracker fashion
"""
class Solution(object):
    def canJump(self, nums):
        """
        :type nums: List[int]
        :rtype: bool
        """
        def helper(pos):
            """
            helper function
            return whether can jump from pos to last index
            """
            if pos == len(nums)-1:
                return True
            maxpos = min(pos + nums[pos], len(nums)-1)
            for k in range(pos+1, maxpos+1):
                if helper(k):
                    return True
            return False

        return helper(0)
            


"""
backtracker time compelxity: O(2^n)

optimize it with dynamic programming

top-down fashion

"""


class Solution1(object):
    def canJump(self, nums):
        """
        :type nums: List[int]
        :rtype: bool
        """
        def helper(idx):
            if memo[idx] != 0:
                return memo[idx]
            maxidx = min(len(nums)-1, idx+nums[idx])
            for i in range(idx+1, maxidx+1):
                if helper(i) == 1:
                    memo[idx] = 1
                    return 1
            memo[idx] = -1
            return -1

        memo = [0] * len(nums)
        memo[-1] = 1
        return helper(0) == 1


"""
bottom up fashion
"""

class Solution2(object):
    def canJump(self, nums):
        """
        :type nums: List[int]
        :rtype: bool
        """
        memo = [False] * len(nums)
        memo[-1] = True
        for i in range(len(nums)-2, -1, -1):
            maxpos = min(i + nums[i], len(nums)-1)
            for k in range(maxpos, i, -1):
                if memo[k]:
                    memo[i] = True
                    break
        return memo[0]


"""
greedy solution

notice that we only need to greedily consider the maximum position we can reach to the right
"""

class Solution3(object):
    def canJump(self, nums):
        """
        :type nums: List[int]
        :rtype: bool
        """
        reach = 0
        for i in range(len(nums)):
            if i > reach:
                return False
            reach = max(reach, i+nums[i])
        return True
        





